    [],nt"num_tags": 0,nt"name": "k193hw-m77t-and-k193hw-h77t-mgd77t-data-and-header-files-for-single-beam-bathymetry-dat-26-1993",nt"isopen":
    true,nt"url": null,nt"notes": "Single-beam bathymetry data along with DGPS
    navigation data was collected as part of the U.S. Geological Survey cruise K-1-93-HW.
    The cruise was conducted in Oahu, Hawaii from February 20 to February 26, 1993.
    The chief scientist was Mike Torresan from the USGS Coastal and Marine Geology office
    in Menlo Park, CA. The purpose of this cruise was to create a detailed bathymetric
    map of the Mamala Bay seafloor that delimits the general extent of the acoustically-resolvable
    dredged material deposits. The geophysical source was a 12 kilohertz (kHz) Raytheon
    system. These data are reformatted from space-delimited ASCII text files located
    in the Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog
    at http://walrus.wr.usgs.gov/infobank/k/k193hw/html/k-1-93-hw.meta.html into MGD77T
    format provided by the NOAA's National Geophysical Data Center(NGDC). The MGD77T
    format includes a header (documentation) file (.h77t) and a data file (.m77t). More
    information regarding this format can be found in the publication listed in the
    Cross_reference section of this metadata file.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
